/*Table structure for table `update_loan_verification` */

DROP TABLE IF EXISTS `update_loan_verification`;

CREATE TABLE `update_loan_verification` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `created_by` varchar(255) DEFAULT NULL,
  `created_datetime` datetime(6) DEFAULT NULL,
  `modified_by` varchar(255) DEFAULT NULL,
  `modified_datetime` datetime(6) DEFAULT NULL,
  `description` varchar(1500) DEFAULT NULL,
  `loan_id` bigint DEFAULT NULL,
  `loan_officer_id` bigint DEFAULT NULL,
  `field_officer_name` varchar(225) DEFAULT NULL,
  `loan_request_id` bigint DEFAULT NULL,
  `report` longblob,
  `status` varchar(225) DEFAULT NULL,
  `verification_update` varchar(1500) DEFAULT NULL,
  `loan` bigint NOT NULL,
  PRIMARY KEY (`id`),
  KEY `FKmk4h28pbgye0fo5aydmudv0i5` (`loan`),
  CONSTRAINT `FKmk4h28pbgye0fo5aydmudv0i5` FOREIGN KEY (`loan`) REFERENCES `apply_loan` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;

